import React,{Component} from 'react'

class  FormComponent extends Component{
    constructor(){
        super();
        this.state = {todoWish:'',todoWishRon:''}
    }
    render(){
        return (
            <form id='formId' onSubmit={this.props.addWishSubmit} >
    
                <input id="inputWish" placeholder='Add your wish' onChange={this.props.onWishTextChange} value={this.state.todoWish} />
                <input id="inputCash" placeholder='Add $' onChange={this.props.onMoneyTextChange} value={this.state.todoWishRon} />
                {
                    this.props.errorInputRon ? <p> Please complete corectly all fields!</p> : ""
                }
                <button id='buttonAdd' type='submit'>Add</button>
    
            </form>
        )

    }
 
}
export default FormComponent
